import { Component } from 'react';

import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {
     monstoers: [],
    };
  }

  componentDidMount() {
    fetch('https://jsonplaceholder.typicode.com/users').then((response) => response.json()).then((users) => this.setState(() => {
      return {monstoers: users};
    }, ));
  }
  render() {
    return (
      <div className="App">
      {
        this.state.monstoers.map((monstoer) => {
          return <div key={monstoer.id}><h1>{monstoer.name}</h1></div>;
        })
      }
      </div>
    );
  }
}

export default App;
